import React, { useState } from 'react';
import { useLocation, useParams } from 'react-router-dom';

function SubscriptionDetails() {
  const { id } = useParams();
  const location = useLocation();
  const { user, subscription } = location.state || {};

  const [formData, setFormData] = useState({
    viewing_hours: '',
    avg_viewing_duration: '',
    content_downloads: '',
    support_tickets: '',
    user_rating: '',
    parental_control: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = () => {
    console.log('Submitted Data:', formData);
  };

  if (!subscription) {
    return <p>Loading subscription details...</p>;
  }

  return (
    <div className="subscription-details">
      <h2>Subscription Details</h2>
      <p><strong>Name:</strong> {subscription.name}</p>
      <p><strong>Cost:</strong> Rs. {subscription.cost}</p>
      <p><strong>Billing Cycle:</strong> {subscription.reminder}</p>
      <p><strong>Sharable:</strong> {subscription.is_shareable ? 'Yes' : 'No'}</p>
      <p><strong>Auto Renew:</strong> {subscription.is_autorenew ? 'Yes' : 'No'}</p>

      <h3>User Info</h3>
      <p><strong>Username:</strong> {user?.username}</p>
      <p><strong>Email:</strong> {user?.email}</p>

      <h3>Usage Preferences</h3>
      {Object.keys(formData).map((key) => (
        <div key={key}>
          <label>{key.replace('_', ' ').toUpperCase()}:</label>
          <select name={key} value={formData[key]} onChange={handleChange}>
            <option value="">Select</option>
            {getOptions(key).map((option) => (
              <option key={option} value={option}>{option}</option>
            ))}
          </select>
        </div>
      ))}

      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
}

const getOptions = (category) => {
  const options = {
    viewing_hours: ['Low (1-10)', 'Medium (11-20)', 'High (21-30)', 'Very High (31-40)'],
    avg_viewing_duration: ['Short (5-50 mins)', 'Moderate (51-100 mins)', 'Long (101-150 mins)', 'Very Long (151-180 mins)'],
    content_downloads: ['Rare (0-12)', 'Intermediate (13-24)', 'Frequent (25-36)', 'Very Frequent (37-49)'],
    support_tickets: ['Low (0-2)', 'Moderate (3-5)', 'High (6-7)', 'Very High (8-9)'],
    user_rating: ['Poor (1-2)', 'Average (3)', 'Good (4)', 'Excellent (5)'],
    parental_control: ['Yes', 'No']
  };
  return options[category] || [];
};

export default SubscriptionDetails;
